import React, { useState, useEffect } from "react"
import './App.css';

var assetData = {};
var liabilities = {};

function App() {

  // const [ data, setData ] = useState({
  //   name: "",
  //   age: 0,
  //   date: "",
  //   programming: "",
  // });

  // useEffect(() => {
  //   // Use fetch to fetch the api from the flask server
  //   // don't need to add "https://localhost/5000" here because we set that as proxy in package.json
  //   fetch("/data").then((res) =>
  //   res.json().then((data) => {
  //     // set the data from the api
  //     setData({
  //       name: data.Name,
  //       age: data.Age,
  //       date: data.Date,
  //       programming: data.Programming,
  //     })
  //   }))
  // }, [])
  // state variable for data
  const [data, setData] = useState([])
  const [dropDownValue, setDropDown] = useState('CAD');

  // GET request
  const fetchAssets = () => {
    fetch(`http://localhost:5000/-net-worth/users/150397569105386686797786709197469348192/assets/`, {mode:"cors"})
      .then(res => res.json())
      .then(json => setData(json))
  }

  // PUT request for currency change
  const fetchCurrency = (data) => {
    console.log(data)
    fetch("http://localhost:5000/-net-worth/users/150397569105386686797786709197469348192/" , {
      method: "put",
      body: JSON.stringify(data),
      headers: {
        "Content-Type": "application/json",
        "Access-Control-Allow-Origin": "*"
      }
    })
    .then(res => res.json())
  }

  useEffect(() => {
    fetchAssets();
  }, []);


  const createAssets = () => {
    // assets
    var assets = {};

    var cashAndInvestments = {};
    cashAndInvestments.chequing = document.getElementById("chequing");
    cashAndInvestments.savingsForTaxes = document.getElementById("savingsForTaxes");
    cashAndInvestments.rainyDayFund = document.getElementById("rainyDayFund");
    cashAndInvestments.savingsForFun = document.getElementById("savingsForFun");
    cashAndInvestments.savingsForTravel = document.getElementById("savingsForTravel");
    cashAndInvestments.savingsForPersonalDevelopment = document.getElementById("savingsForPersonalDevelopment");
    cashAndInvestments.investment1 = document.getElementById("investment1");
    cashAndInvestments.investment2 = document.getElementById("investment2");
    cashAndInvestments.investment3 = document.getElementById("investment3");

    var longTermAssets = {};
    longTermAssets.primaryHome = document.getElementById("primaryHome");;
    longTermAssets.secondHome = document.getElementById("secondHome");;
    longTermAssets.other = document.getElementById("other");;

    assets.cashAndInvestments = cashAndInvestments;
    assets.longTermAssets = longTermAssets;

    assetData.assets = assets;
    console.log(assetData)
  }

  const createLiabilities = () => {
    // liabilities
    var shortTermLiabilities = {};
    shortTermLiabilities.creditCard1 = 4342.00;
    shortTermLiabilities.creditCard2 = 322.00;

    var longTermDebt = {};
    longTermDebt.mortgage1 = 250999.00;
    longTermDebt.mortgage2 = 632634.00;
    longTermDebt.lineOfCredit = 10000.00;
    longTermDebt.investmentLoan = 10000.00;

    liabilities.shortTermLiabilities = shortTermLiabilities;
    liabilities.longTermDebt = longTermDebt;
  }

  const handleDropDown = (e) => {
    let currency = e.target.value
    setDropDown(currency);
    fetchCurrency(currency);
  }

  return (
    <div className="container">
      <h1>Tracking Your Networth</h1>
      {/* TODO: add currency dropdown here */}
      <div className="dropDown">
        <label>
          <select value={dropDownValue} onChange={handleDropDown}>
            <option value="CAD">CAD</option>
            <option value="INR">INR</option>
            <option value="USD">USD</option>
          </select>
        </label>
      </div>
      {/* TODO: make total net worth here side by side */}
      <div>
        <h3>Total Networth</h3>
        <p>232323.00</p>
      </div>
      <h3>Assets</h3>
          <table>
            <tbody>
              <tr>
                <th>Cash and Investments</th>
              </tr>
              <tr>
                <td>Chequing</td>
                <td><div>$<input type="text" id="chequing" name="chequing" defaultValue={2000.00} required></input></div></td>
              </tr>
              <tr>
                <td>Savings for Taxes</td>
                <td><div>$<input type="text" id="savingsForTaxes" name="savingsForTaxes" defaultValue={4000.00}></input></div></td>
              </tr>
              <tr>
                <td>Rainy Day Fund</td>
                <td><div>$<input type="text" id="rainyDayFund" name="rainyDayFund" defaultValue={506.00}></input></div></td>
              </tr>
              <tr>
                <td>Savings for Fun</td>
                <td><div>$<input type="text" id="savingsForFun" name="savingsForFun" defaultValue={5000.00}></input></div></td>
              </tr>
              <tr>
                <td>Savings for Travel</td>
                <td><input type="text" id="savingsForTravel" name="savingsForTravel" defaultValue={400.00}></input></td>
              </tr>
              <tr>
                <td>Savings for Personal Development</td>
                <td><input type="text" id="savingsForPersonalDevelopment" name="savingsForPersonalDevelopment" defaultValue={200.00}></input></td>
              </tr>
              <tr>
                <td>Investment 1</td>
                <td><input type="text" id="investment1" name="investment1" defaultValue={5000.00}></input></td>
              </tr>
              <tr>
                <td>Investment 2</td>
                <td><input type="text" id="investment2" name="investment2" defaultValue={6000.00}></input></td>
              </tr>
              <tr>
                <td>Investment 3</td>
                <td><input type="text" id="investment3" name="investment3" defaultValue={2400.00}></input></td>
              </tr>
              <tr>
                <th>Long Term Assets</th>
              </tr>
              <tr>
                <td>Primary Home</td>
                <td><input type="text" id="primaryHome" name="primaryHome" defaultValue={455000.00}></input></td>
              </tr>
              <tr>
                <td>Second Home</td>
                <td><input type="text" id="secondHome" name="secondHome" defaultValue={156431.00}></input></td>
              </tr>
              <tr>
                <td>Other</td>
                <td><input type="text" id="other" name="other" defaultValue={0.00}></input></td>
              </tr>
              <tr>
                <th>Total Assets</th>
              </tr>
            </tbody>
        </table>
        <button onClick={() => createAssets()}> Save Assets </button>
      <h3>Liabilities</h3>
        <table>
          <tbody>
            <tr>
              <th>Short Term Liabilities</th>
              <th>Monthly Payment</th>
            </tr>
            <tr>
              <td>Credit Card 1</td>
              <td><div>$ 200.00</div></td>
              <td><div><input type="text" id="creditCard1" name="creditCard1"></input></div></td>
            </tr>
            <tr>
              <td>Credit Card 2</td>
              <td><div>$ 150.00</div></td>
              <td><div><input type="text" id="creditCard2" name="creditCard2"></input></div></td>
            </tr>
            <tr>
              <th>Long Term Debt</th>
            </tr>
            <tr>
              <td>Mortage 1</td>
              <td><div>$ 2000.00</div></td>
              <td><div><input type="text" id="mortgage1" name="mortgage1"></input></div></td>
            </tr>
            <tr>
              <td>Mortage 2</td>
              <td><div>$ 3500.00</div></td>
              <td><div><input type="text" id="mortgage2" name="mortgage2"></input></div></td>
            </tr>
            <tr>
              <td>Line Of Credit</td>
              <td><div>$ 500.00</div></td>
              <td><div><input type="text" id="lineOfCredit" name="lineOfCredit"></input></div></td>
            </tr>
            <tr>
              <td>Investment Loan</td>
              <td><div>$ 700.00</div></td>
              <td><div><input type="text" id="investmentLoan" name="investmentLoan"></input></div></td>
            </tr>
          </tbody>
        </table>
        <button onClick={() => createLiabilities()}> Save Liabilities </button>
    </div>
  );
}

export default App;
